var $bm_rt;
var floatAmpY, floatAmpX, floatSpeedY, floatSpeedX, floatY, floatX, bounceGap, triggerTime, dt, bounceAmp, bounceFreq, bounceDecay, bounceY;
floatAmpY = 12;
floatAmpX = 6;
floatSpeedY = 0.08;
floatSpeedX = 0.05;
floatY = $bm_mul(floatAmpY, Math.sin(time * floatSpeedY * Math.PI * 2));
floatX = $bm_mul(floatAmpX, Math.cos(time * floatSpeedX * Math.PI * 2));
seedRandom(index, true);
bounceGap = random(10, 12);
triggerTime = $bm_mul(Math.floor(time / bounceGap), bounceGap);
dt = $bm_sub(time, triggerTime);
bounceAmp = 8;
bounceFreq = 1.5;
bounceDecay = 4;
bounceY = $bm_sum(dt, 1.5) ? $bm_div($bm_mul(bounceAmp, Math.sin(bounceFreq * dt * Math.PI * 2)), Math.exp(bounceDecay * dt)) : 0;
$bm_rt = $bm_sum(value, [
    floatX,
    floatY + bounceY
]);

var $bm_rt;
var freq, decay, amp, t, gap, triggerTime, dt, yOffset;
freq = 1;
decay = 3;
amp = 10;
seedRandom(index, true);
t = time;
gap = random(10, 12);
triggerTime = $bm_mul(Math.floor(t / gap), gap);
dt = $bm_sub(t, triggerTime);
yOffset = $bm_sum(dt, 1.5) ? $bm_div($bm_mul(amp, Math.sin(freq * dt * Math.PI * 2)), Math.exp(decay * dt)) : 0;
$bm_rt = $bm_sum(value, [
    0,
    yOffset
]);
